import React from 'react'

/*
function Great(){
    return <h1>HellO Daniel</h1>
}
*/
const Great = (props) => {
    console.log(props);

    return (
    <h1>Hello {props.name} a.k.a  {props.heroName}</h1>
    
    )
}

export default Great;
